      const htmlVector = q("#html-vector")[0];
      const htmlLogo = q("#html-logo")[0];
      if (!avatar || !htmlVector || !htmlLogo) return;
      // 1) Reset garis jadi belum tergambar

      // ScrollTrigger.create({
      //   trigger: q("#halo"),
      //   pin: true,
